import React from 'react';
//import logo from './logo.svg';
//import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Route} from "react-router-dom";

import Navbar from "./components/navbar.component";
import CreateStudent from "./components/create-student.component";
import CreateProfessor from "./components/create-professor.component";
import StudentLogin from "./components/student-login.component";
import ProfessorLogin from "./components/professor-login.component";

import Course from "./components/addCourse.component"

import Professor from "./components/professor-page.component";


function App() {
  return (
    <Router>
      <div className="container">
      <Navbar />
      <br/>
      <Route path="/createstudent" component={CreateStudent} />
      <Route path="/studentlogin" component={StudentLogin} />
      <Route path="/professorlogin" component={ProfessorLogin} />
      <Route path="/createprofessor" component={CreateProfessor} />
      <Route path="/professor" component={Professor} />
      <Route path="/course" component={Course} />
      {/*<Route path="/create" component={CreateExercise} />
      <Route path="/user" component={CreateUser} /> */}
      </div>
    </Router>
  )
}

export default App;
